import React from 'react';


function CardModel(props) {
    return ( 
        <div className='w-[450px] rounded-[55px] h-[600px]  shadow-2xl shadow-black bg-zinc-200'>
            <img className='rounded-t-[53px] h-[85%]' src={props.src}></img>
            <div className='flex flex-1  justify-center'>

            <button className='-my-8 rounded-full w-72 h-16 bg-white border-2 shadow-xl text-2xl'>Usar Modelo</button>
        </div>
        </div>
    );
}

export default CardModel;
